import React, { useEffect, useState } from "react";

const Test = () => {
  const [productsData, setproductsData] = useState();
  const [isLoading, setIsLoading] = useState(false);
  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    setIsLoading(true);
    try {
      const responseData = await fetch("https://dummyjson.com/products");
      const ConvertDat = await responseData.json();
      const finalData = await ConvertDat.products;
      console.log("ðŸš€ ~ file: Test.jsx:16 ~ fetchData ~ finalData:", finalData);

      setproductsData(finalData);
      setIsLoading(false);
    } catch (error) {
      setIsLoading(false);

      throw new Error("Error Occured While Fetching Data");
    }
  };
  return (
    <div>
      {!isLoading && productsData && (
        <div>
          {productsData.map((product) => {
            return (
              <>
                <div>
                  <h1>{product.title}</h1>
                </div>
                <div>
                  <h6>{product.description}</h6>
                </div>
                <div>
                  {product.price > 1000 ? (
                    <h6 style={{colo}}>{product.price}</h6>
                  ) : (
                    <h6>{product.price}</h6>
                  )}
                </div>
              </>
            );
          })}
        </div>
      )}
    </div>
  );
};

export default Test;
